import './App.css';
import Header from './Header';

function App() {
  return (
    <div className="wrapper">
      <Header/>

      <div className="content">
        <div className="posts">
          <div className='post'>
            <div></div>
          </div>
        </div>
      </div>

    </div>
  );
}

export default App;
